script: |
  super -f text -I q763.spq | sort > q763.out

inputs:
  - name: q763.spq
    data: |
      SELECT ALL + tab2.col0 * col2 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT ( + col0 * - col1 ) IN ( tab2.col0 + col1 * col0 );
  - name: tab2

outputs:
  - name: q763.out
    data: |
      189
      2028
      3002
